--
-- Drop tables bottom-up
--

DROP TABLE IF EXISTS `pending_email_update`;
DROP TABLE IF EXISTS `pending_password_reset`;
DROP TABLE IF EXISTS `user_subject_stats`;
DROP TABLE IF EXISTS `user_subject`;
DROP TABLE IF EXISTS `user_stats`;
DROP TABLE IF EXISTS `user_role`;
DROP TABLE IF EXISTS `user_detail`;
DROP TABLE IF EXISTS `user_badge`;
DROP TABLE IF EXISTS `user_auth`;
DROP TABLE IF EXISTS `pending_user`;
DROP TABLE IF EXISTS `attempt`;
DROP TABLE IF EXISTS `comment_vote`;
DROP TABLE IF EXISTS `comment`;
DROP TABLE IF EXISTS `user`;
DROP TABLE IF EXISTS `question`;

--
-- Table structure for table `badge`
--
DROP TABLE IF EXISTS `badge`;
CREATE TABLE `badge` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `icon` text NOT NULL COMMENT 'URI to the icon to be displayed when badge is to be shown.',
  `subject` int NOT NULL COMMENT 'The subject this badge belongs to.',
  `description` text COMMENT 'Optional extensive description of this badge.',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='All badges user may earn.';

--
-- Table structure for table `institute`
--
DROP TABLE IF EXISTS `institute`;
CREATE TABLE `institute` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `icon` text NOT NULL COMMENT 'URI to the image to represent this institute.',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Supported institutes.\n';

--
-- Table structure for table `pending_user`
--
CREATE TABLE `pending_user` (
  `id` int NOT NULL AUTO_INCREMENT,
  `email` varchar(255) NOT NULL,
  `digest` varchar(64) NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Submitted register requests that are to be verified and inserted.';

--
-- Table structure for table `user`
--
CREATE TABLE `user` (
  `id` int NOT NULL AUTO_INCREMENT,
  `display_name` char(64) NOT NULL,
  `avatar` text NOT NULL COMMENT 'URI to the image to be shown as this user''s avatar.',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='This table holds common information of a user.';

--
-- Table structure for table `user_auth`
--
CREATE TABLE `user_auth` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `email` varchar(255) NOT NULL,
  `digest` varchar(64) NOT NULL COMMENT 'The bcrypt hash of the user''s password',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id_UNIQUE` (`user_id`),
  UNIQUE KEY `email_UNIQUE` (`email`),
  CONSTRAINT `user_auth_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Authentication information of a user';

--
-- Table structure for table `user_badge`
--
CREATE TABLE `user_badge` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `badge_id` int NOT NULL,
  `is_displayed` tinyint NOT NULL DEFAULT '0' COMMENT 'Whether this badge is displayed',
  PRIMARY KEY (`id`),
  KEY `user_id_fk_idx` (`user_id`),
  KEY `badge_id_fk_idx` (`badge_id`),
  CONSTRAINT `user_badge_badge_id_fk` FOREIGN KEY (`badge_id`) REFERENCES `badge` (`id`),
  CONSTRAINT `user_badge_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Badges each user has earned. This table is more often updated by the system when users meet a criteria of a badge. Other than that, users'' actions to display or hide a badge also update this table.';

--
-- Table structure for table `user_detail`
--
CREATE TABLE `user_detail` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `inst_id` int,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id_UNIQUE` (`user_id`),
  KEY `user_id_fk_idx` (`user_id`),
  KEY `inst_id_fk_idx` (`inst_id`),
  CONSTRAINT `user_detail_inst_id_fk` FOREIGN KEY (`inst_id`) REFERENCES `institute` (`id`),
  CONSTRAINT `user_detail_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Extendable details of a user.';

--
-- Table structure for table `user_role`
--
CREATE TABLE `user_role` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `role` tinyint NOT NULL COMMENT 'The role constant value defined by the backend.',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id_UNIQUE` (`user_id`),
  CONSTRAINT `user_role_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='The role each user is assigned to. Roles are defined by the backend.';

--
-- Table structure for table `user_stats`
--
CREATE TABLE `user_stats` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `total_endorsed` int NOT NULL DEFAULT '0' COMMENT 'The total number of comments made by this user that are endorsed.',
  `total_attempted` int NOT NULL DEFAULT '0' COMMENT 'The total number of questions that have been attempted (regardless of subject) by this user.',
  `total_correct` int NOT NULL DEFAULT '0' COMMENT 'The total number of questions (regardless of subject) that are correctly attempted by this user.',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id_UNIQUE` (`user_id`),
  CONSTRAINT `user_stats_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='General statistics of user.';

--
-- Table structure for table `user_subject`
--
CREATE TABLE `user_subject` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `subject` int NOT NULL,
  `is_enabled` tinyint NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `user_subject_user_id_fk_idx` (`user_id`),
  CONSTRAINT `user_subject_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='This table is a Cartesian product of table user and supported subjects.';

--
-- Table structure for table `user_subject_stats`
--
CREATE TABLE `user_subject_stats` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `subject` int NOT NULL,
  `total_attempted` int NOT NULL DEFAULT '0' COMMENT 'The total number of questions of this subject this user has attempted.',
  `total_correct` int NOT NULL DEFAULT '0' COMMENT 'The total number of questions that are correctly attempted.',
  `total_correct_first` int NOT NULL DEFAULT '0' COMMENT 'The total number of questions that are attempted correctly on the first try.',
  PRIMARY KEY (`id`),
  KEY `user_subject_stats_user_id_fk_idx` (`user_id`),
  CONSTRAINT `user_subject_stats_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Statistics of each user''s performance on each subject. This is also a Cartesian product';

--
-- Table structure for table `pending_password_reset`
--
CREATE TABLE `pending_password_reset` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `token` varchar(64) NOT NULL COMMENT 'The JWT signed off to authorise this password reset.',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `pending_password_reset_user_id_fk_idx` (`user_id`),
  CONSTRAINT `pending_password_reset_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Submitted password reset requests.';

--
-- Table structure for table `pending_email_update`
--
CREATE TABLE `pending_email_update` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `email` varchar(255) NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `pending_email_update_user_id_fk_idx` (`user_id`),
  CONSTRAINT `pending_email_update_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Submitted email update requests.';

--
-- Table structure for table `question`
--
CREATE TABLE `question` (
  `id` int NOT NULL AUTO_INCREMENT,
  `subject` int NOT NULL,
  `topic` int NOT NULL,
  `type` int NOT NULL,
  `difficulty` int NOT NULL,
  `body` text NOT NULL COMMENT 'URI to the question body image.',
  `answer` text NOT NULL COMMENT 'Serialised string of expected answer in a certain format.',
  `title` varchar(255) NOT NULL COMMENT 'Short title of the question.',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='All questions provided for users to make attempts.';

--
-- Table structure for table `attempt`
--
CREATE TABLE `attempt` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `question_id` int NOT NULL,
  `answer` text NOT NULL COMMENT 'The constructed serialised answer of this attempt.',
  `is_correct` tinyint NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `attempt_user_id_idx` (`user_id`),
  KEY `attempt_question_id_fk_idx` (`question_id`),
  CONSTRAINT `attempt_question_id_fk` FOREIGN KEY (`question_id`) REFERENCES `question` (`id`),
  CONSTRAINT `attempt_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Attempts made by users to questions.';

--
-- Table structure for table `comment`
--
CREATE TABLE `comment` (
  `id` int NOT NULL AUTO_INCREMENT,
  `commenter_id` int NOT NULL COMMENT 'The user who created this comment.',
  `question_id` int NOT NULL,
  `content` text NOT NULL,
  `content_type` tinyint NOT NULL COMMENT '0 = plain text, 1 = latex script',
  `is_endorsed` tinyint NOT NULL DEFAULT '0',
  `total_votes` int NOT NULL DEFAULT '0' COMMENT 'Should be equal to (all upvotes) - (all downvotes).',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `comment_user_id_fk_idx` (`commenter_id`),
  KEY `comment_question_id_fk_idx` (`question_id`),
  CONSTRAINT `comment_question_id_fk` FOREIGN KEY (`question_id`) REFERENCES `question` (`id`),
  CONSTRAINT `comment_user_id_fk` FOREIGN KEY (`commenter_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Comments made to questions.';

--
-- Table structure for table `comment_vote`
--
CREATE TABLE `comment_vote` (
  `id` int NOT NULL AUTO_INCREMENT,
  `voter_id` int NOT NULL COMMENT 'The user who made this vote.',
  `comment_id` int NOT NULL,
  `direction` tinyint NOT NULL COMMENT '1 = upvote, -1 = downvote',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `comment_vote_user_id_fk_idx` (`voter_id`),
  KEY `comment_vote_comment_id_fk_idx` (`comment_id`),
  CONSTRAINT `comment_vote_comment_id_fk` FOREIGN KEY (`comment_id`) REFERENCES `comment` (`id`),
  CONSTRAINT `comment_vote_user_id_fk` FOREIGN KEY (`voter_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Votes on comments. Each user may have only one entry per comment in this table. When a user upvotes a comment, an entry is inserted. If the user downvotes the same comment, the entry created should be updated. If the user cancels the vote, the entry should be removed (i.e. direction shouldn''t be 0).';

